window.bookSummaryJSON = "<p><b>The first man blew up my car. The second shot at me on my morning run. The third man cornered me after work. And the fourth? He just watches me from the shadows.</b></p> <p>On the night of the blood moon, I get my memories restored and learn that I'm not human - I'm the Goddess of Pain. And the men who tried to kill me? They just might be the loves of my immortal life. But what's an \"I love you\" compared to an assassination attempt? Someone paid these men to kill me, and if I don't find out who this person is, I'll lose everything and everyone I ever loved.</p> <p>But they underestimated me. I don't just endure pain - I make it. And the people who tried to hurt my family? They'll suffer for what they've done.</p> <p><b><i>Goddess of Pain</i></b><b> is a paranormal reverse harem romance stand-alone that is part of the Blood Moon Rising world. It contains strong language, violence, and sexual situations.</b></p>"; 
